import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Button,
  Paper,
} from '@mui/material';
import { ShoppingCart as CartIcon } from '@mui/icons-material';

const Cart = () => {
  const navigate = useNavigate();

  return (
    <Container maxWidth="lg" sx={{ py: 8 }}>
      <Paper
        sx={{
          p: 4,
          background: 'rgba(255,255,255,0.05)',
          backdropFilter: 'blur(10px)',
          border: '1px solid rgba(255,255,255,0.1)',
        }}
      >
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            textAlign: 'center',
            py: 4,
          }}
        >
          <CartIcon sx={{ fontSize: 60, color: 'rgba(255,255,255,0.7)', mb: 2 }} />
          <Typography variant="h4" sx={{ color: 'white', mb: 2 }}>
            Your Cart is Empty
          </Typography>
          <Typography
            variant="body1"
            sx={{ color: 'rgba(255,255,255,0.7)', mb: 4, maxWidth: 500 }}
          >
            Explore our collection of telescopes, space merchandise, and astronomical equipment
            to begin your cosmic journey.
          </Typography>
          <Button
            variant="contained"
            size="large"
            onClick={() => navigate('/products')}
            sx={{
              bgcolor: '#7c4dff',
              fontSize: '1.1rem',
              py: 1.5,
              px: 4,
              '&:hover': {
                bgcolor: '#6c3fff',
                transform: 'translateY(-2px)',
              },
              transition: 'all 0.3s ease-in-out',
            }}
          >
            Start Shopping
          </Button>
        </Box>
      </Paper>
    </Container>
  );
};

export default Cart;
